import React from "react";
import "./Edu.css";

function Edu() {
    return (
        <div className="edu">
        <h1>Education</h1>
        <div className="edu-container">
            <div className="edu-item">
            <h2>University of Example</h2>
            <p>Bachelor of Science in Computer Science</p>
            <p>Graduated: 2020</p>
            </div>
            <div className="edu-item">
            <h2>Example High School</h2>
            <p>High School Diploma</p>
            <p>Graduated: 2016</p>
            </div>
        </div>
        </div>
    );
    }

    export default Edu;
